import React from "react";
import head from "next/head";
import AppLayout from "../components/AppLayout";

const Profile = () => {
  return (
    <>
      <head>
        <meta charSet="utf-8" />
        <title>내 프로필</title>
      </head>
      <AppLayout>My Profile </AppLayout>
    </>
  );
};

export default Profile;
